import logo from "../assets/images/logoW.png"
import "./Nav.js"

export const Nav = () => {
  // const buttonStyle = {
  //   fontSize: "25px",
  //   color: "white",
  //   marginRight: "30px",
  // }
  // const logoStyle = {
  //   height: "150px",
  //   width: "150px",
  //   margin: "0px"
  // }

  return(
      <nav className="navbar navbar-expand-lg navbar-dark">
        <a className="navbar-brand" href="">
          <img src={logo} style={logoStyle} alt="brand"/>
        </a>
        <div className="collapse navbar-collapse" id="navToggler"> 
          <ul className="navbar-nav ml-auto mt-2 mt-lg-0">
            <li className="nav-item">
              <button className="btn btn-lg" style={buttonStyle}>Web Development</button>
            </li>
            <li className="nav-item">
              <button className="btn btn-lg" style={buttonStyle}>UX Design</button>
            </li>
            <li className="nav-item">
              <button className="btn btn-lg" style={buttonStyle}>Get to Know Me</button>
            </li>
          </ul>
        </div>
        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navToggler" aria-controls="navToggler" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
      </nav>
  )
};
